        "description": "<p>The protolog of \"boldo\" by Molina does not indicate dioecious species, however boldo if it is a dioecious diclino tree, as Gay and Reiche indicates, ie, trees with male flowers (male) other than trees with female flowers ( females).\nThe inflorescences of trees females are smaller, less flowers than those of males and as far as I could see the trees trees females are more sparse cups, of smaller leaves and are more scarce than males, at least in northern distribution\n</p><p>El protologo del \"boldo\" escrito por Molina no indica dioecia de la especie, sin embargo el boldo si es un árbol diclino dioico, como indica Gay y Reiche, es decir, árboles con flores masculinas (machos) distintos de árboles con flores femeninas (hembras).\n</p>\nLas inflorescencias de los árboles hembras son mas pequeñas, de menos flores que las de los árboles machos y hasta donde he podido ver los árboles hembras son de copas mas ralas, de hojas mas pequeñas y son mas escasos que los machos, por lo menos en la zona norte de distribución",
