        "description": "Cymbopogon citratus. Common name: Lemongrass.\n<p>Lemongrass grows in large, dense clumps and is rarely seen to flower. Its long slender leaves are hairy and sharp. While leaves have the distinct lemony fragrance, it is the lower part of the stem which is most used in cooking. The bulbous stem is usually bruised to release its flavour, before adding to many curry dishes, or sliced before being pounded to a paste. \n</p>\nLemongrass is an essential cooking ingredient in Asia. It is used in Thai curries and soups, as well as Vietnamese salads and spring rolls.",
