        "width": 3510,
        "height": 4484,
        "size": 2163055,
        "description": "Esta ilustração faz parte de um projeto chamado Interações Mutuaísticas que acompanha a pesquisa da doutoranda Georgia Sinimbu, estudante da Universidade de Utah (Estados Unidos) e pesquisadora do Inpa (Instituto Nacional de Pesquisas da Amazônia). O projeto foi aprovado pelo Fundo de Apoio de Cultura (FAC-Distrito Federal, Brasil) e está em andamento. Ele consiste na elaboração de 30 pranchas de ilustração científica nas técnicas aquarela e nanquim.\nA pesquisa busca entender como as interações entre plantas do gênero Inga e formiga contribuem para a distribuição, a diversidade e a abundância. Em geral, assume-se que as planas desenvolvem nectários - glândulas presentes principalmente em folhas, pecíolos e estípulas - para atraírem formigas a fim de que estas protejam as plantas contra herbívoros.",
