        "source": "wikimedia",
        "url": "https://upload.wikimedia.org/wikipedia/commons/7/7b/The_hunter_and_the_trapper_in_North_America%3B_or%2C_Romantic_adventures_in_field_and_forest._From_the_French_of_B%C3%A9n%C3%A9dict_R%C3%A9voil_%281875%29_%2814746986501%29.jpg",
        "title": "File:The hunter and the trapper in North America; or, Romantic adventures in field and forest. From the French of Bénédict Révoil (1875) (14746986501).jpg",
        "width": 2060,
        "height": 2516,
        "size": 1467915,
        "description": "<br>\n<p><b>Identifier</b>: huntertrapperinn1875rv (<a class=\"external text\" href=\"https://commons.wikimedia.org/w/index.php?title=Special%3ASearch&amp;profile=default&amp;fulltext=Search&amp;search=insource%3A%2Fhuntertrapperinn1875rv%2F\">find matches</a>)<br>\n<b>Title</b>: <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookidhuntertrapperinn1875rv\">The hunter and the trapper in North America ; or, Romantic adventures in field and forest. From the French of Bénédict Révoil</a><br>\n<b>Year</b>: <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookyear1875\">1875</a> (<a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookdecade1870\">1870s</a>)<br>\n<b>Authors</b>:  <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookauthorR__voil__B__n__dict_Henry__1816_1882\">Révoil, Bénédict Henry, 1816-1882</a> <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookauthorAdams__W__H__Davenport__William_Henry_Davenport___1828_1891\">Adams, W. H. Davenport (William Henry Davenport), 1828-1891</a><br>\n<b>Subjects</b>:  <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/booksubjectHunting\">Hunting</a> <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/booksubjectGame_and_game_birds\">Game and game-birds</a><br>\n<b>Publisher</b>:  <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookpublisherLondon__New_York___T__Nelson_and_Sons\">London, New York : T. Nelson and Sons</a><br>\n<b>Contributing Library</b>:  <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookcontributorHarold_B__Lee_Library\">Harold B. Lee Library</a><br>\n<b>Digitizing Sponsor</b>:  <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/booksponsorBrigham_Young_University\">Brigham Young University</a><br>\n<br>\n<b>View Book Page</b>: <a rel=\"nofollow\" class=\"external text\" href=\"https://archive.org/stream/huntertrapperinn1875rv/huntertrapperinn1875rv#page/n153/mode/1up\">Book Viewer</a><br>\n<b>About This Book</b>: <a rel=\"nofollow\" class=\"external text\" href=\"https://archive.org/details/huntertrapperinn1875rv\">Catalog Entry</a><br>\n<b>View All Images</b>: <a rel=\"nofollow\" class=\"external text\" href=\"https://www.flickr.com/photos/internetarchivebookimages/tags/bookidhuntertrapperinn1875rv\">All Images From Book</a><br>\nClick here to <a rel=\"nofollow\" class=\"external text\" href=\"https://archive.org/stream/huntertrapperinn1875rv/huntertrapperinn1875rv#page/n153/mode/1up\"><b>view book online</b></a> to see this illustration in context in a browseable online version of this book.<br>\n<br>\n<b>Text Appearing Before Image:</b><br>\n<i>back, with bristlinghair, and tail between his legs,*and howling hoarsely toattract my attention. I looked before me, and could notrepress a cry of horror. About forty paces distant a wild cat and a rattlesnakewere defying each other to the combat; their eyes shotforth flame and fire; one hissed, the other mewed. Theserpent moved in folds, marked by grace and suppleness;the cat raised his back, and appeared to wait for anopportunity of pouncing upon his enemy. Suddenly theserpent made a spring, but the cat anticipated it, andleaped aside; but as he returned to the attack, the ser-pent bit him in the lip, and though grasped immedi-ately in the wild cat*s claws, succeeded in infolding hisbody and violently compressing it. I put an end to theagony of both; my two barrels stretched them on theground, dead, and incapable henceforth of doing anyinjury. According to the Indians, the rattlesnake lives on thopestiferous air of the marshes, and on all corrupted matter, 150 FATTENING WILD CATS.</i><br>\n<b>Text Appearing After Image:</b><br>\n<i>THEIR EYES SHOT FORTH FLAME AND FIRE. while the wild cat is nourished by the result of the quarrelsof headstrong and deceitful persons; so, when the Red-skins would refer to the internal dissensions of a familyof their tribe, they say, in their semi-oriental language : *^ In the wigwam of X wild cats are fattened. - In hunting the tom-cats of the American swamps, UNSUCCESSFUL SHOOTING. 151 the hunters generally make use of pistols. It is not thatthe majority are unskilled in the management of thisweapon; but, by means of their revolvers, it is possiblefor them to wound the cat, when he begins to leap fromtree to tree, and renders th^fun of the sportsmen morecomplete. In a word, the animal is a living target,against which each person displays his skill. Such amode of hunting is not in agreement, certainly, with the^* law Grammont; but as the French legislator is un-known across the seas, and as, in general, hunters are notgifted with any very tender sensibilities, especially towardswil</i><br>\n<br>\n<b>Note About Images</b><br>\n</p>\n<i>Please note that these images are extracted from scanned page images that may have been digitally enhanced for readability - coloration and appearance of these illustrations may not perfectly resemble the original work.</i>",
