        "size": 691285,
        "description": "<i><a href=\"https://en.wikipedia.org/wiki/Acmella\" class=\"extiw\" title=\"w:Acmella\">Acmella</a> ciliata</i>, Fringed Pod Toothache Plant is native to <a href=\"https://en.wikipedia.org/wiki/South_America\" class=\"extiw\" title=\"w:South America\">South America</a>, widely naturalized in South and South East <a href=\"https://en.wikipedia.org/wiki/Asia\" class=\"extiw\" title=\"w:Asia\">Asia</a>, is a flowering herb in the plant family <a href=\"https://en.wikipedia.org/wiki/Asteraceae\" class=\"extiw\" title=\"w:Asteraceae\">Asteraceae</a>.\n<p><br>\nIt is a perennial gerb, 30-80 cm tall. Stems are usually prostrate to rising, rooting at nodes, green to purple.\n</p>\nTaken at <a href=\"https://en.wikipedia.org/wiki/Kadavoor\" class=\"extiw\" title=\"w:Kadavoor\">Kadavoor</a>, <a href=\"https://en.wikipedia.org/wiki/Kerala\" class=\"extiw\" title=\"w:Kerala\">Kerala</a>, <a href=\"https://en.wikipedia.org/wiki/India\" class=\"extiw\" title=\"w:India\">India</a>",
