        "description": "Poster of yellow flowers. From left to right and top to bottom: <br>\n<ol><li><b>Field Marigold</b> (<i>Calendula arvensis</i>)</li>\n<li><i>Coleostephus myconis</i></li>\n<li><b>Yellow Chamomile</b> (<i>Cota tinctoria</i>)</li>\n<li><b>African Daisy</b> (<i>Arctotis sp.</i>)</li>\n<li>'<i>Lance-leaved Coreopsis</i> (<i>Coreopsis lanceolata</i>)</li>\n<li><b>Spanish Oyster</b> (<i>Scolymus hispanicum</i>)</li>\n<li><b>Smooth oxeye</b> (<i>Helliopsis heliantoides</i>)</li>\n<li><b>Bermuda Buttercup</b> (<i>Oxalis pes-caprae</i>)</li>\n<li><b>Treasure Flower </b> (<i>Gazania rigens</i>)</li>\n<li><b>Common Hawkweed</b> (<i>Hieracium lachenalii</i>)</li>\n<li><b>Sunflower</b> (<i>Helianthus annuus</i>)</li>\n<li><b>Sow Thistle</b> (<i>Sonchis oleraceus</i>)</li></ol>",
