        "width": 3800,
        "height": 5000,
        "size": 6601324,
        "description": "<br>\n<p>A poster of twelve different species of flowers of the family <a href=\"https://en.wikipedia.org/wiki/Asteraceae\" class=\"extiw\" title=\"w:Asteraceae\">Asteraceae</a>, belonging to the three most representative subfamilies: <a href=\"https://en.wikipedia.org/wiki/Asteroideae\" class=\"extiw\" title=\"w:Asteroideae\">Asteroideae</a>, <a href=\"https://en.wikipedia.org/wiki/Cichorioideae\" class=\"extiw\" title=\"w:Cichorioideae\">Cichorioideae</a> and <a href=\"https://en.wikipedia.org/wiki/Carduoideae\" class=\"extiw\" title=\"w:Carduoideae\">Carduoideae</a>: <br>\n</p>\n<ol><li><b>Yellow Chamomille</b> - <i><a href=\"https://en.wikipedia.org/wiki/Anthemis_tinctoria\" class=\"extiw\" title=\"en:Anthemis tinctoria\">Anthemis tinctoria</a></i> (Asteroideae)</li>\n<li><b>Crown Daisy</b> - <i><a href=\"https://en.wikipedia.org/wiki/Glebionis_coronarium\" class=\"extiw\" title=\"w:Glebionis coronarium\">Glebionis coronarium</a></i> (Asteroideae)</li>\n<li><b>Corn Marigold</b> - <i><a href=\"https://en.wikipedia.org/wiki/Coleostephus_myconis\" class=\"extiw\" title=\"w:Coleostephus myconis\">Coleostephus myconis</a></i> (Asteroideae)</li>\n<li><b>Marguerite</b> - <i><a href=\"https://en.wikipedia.org/wiki/Argyranthemum_frutescens\" class=\"extiw\" title=\"w:Argyranthemum frutescens\">Argyranthemum frutescens</a></i> 'Bridesmaid' (Asteroideae)</li>\n<li><b>Sow Thistle</b> - <i><a href=\"https://en.wikipedia.org/wiki/Sonchus_oleraceus\" class=\"extiw\" title=\"w:Sonchus oleraceus\">Sonchus oleraceus</a></i> (Cichoireideae)</li>\n<li><b>Chicory</b> - <i><a href=\"https://en.wikipedia.org/wiki/Cichorium_intybus\" class=\"extiw\" title=\"w:Cichorium intybus\">Cichorium intybus</a></i> (Cichoireideae)</li>\n<li><b>Treasure Flower</b> - <i><a href=\"https://en.wikipedia.org/wiki/Gazania_rigens\" class=\"extiw\" title=\"w:Gazania rigens\">Gazania rigens</a></i> (Cichoireideae)</li>\n<li><b>Galactites</b> - <i><a href=\"https://en.wikipedia.org/wiki/Galactites_tomentosa\" class=\"extiw\" title=\"w:Galactites tomentosa\">Galactites tomentosa</a></i> (Carduoideae)</li>\n<li><b>Field Marigold</b> - <i><a href=\"https://en.wikipedia.org/wiki/Calendula_arvensis\" class=\"extiw\" title=\"w:Calendula arvensis\">Calendula arvensis</a></i> (Asteroideae)</li>\n<li><b>Ox-eye daisy</b> – <i><a href=\"https://en.wikipedia.org/wiki/Leucanthemum_vulgare\" class=\"extiw\" title=\"en:Leucanthemum vulgare\">Leucanthemum vulgare</a></i> (Asteroideae)</li>\n<li><b>Common Hawkweed</b> - <i><a href=\"https://en.wikipedia.org/wiki/Hieracium_lachenalii\" class=\"extiw\" title=\"w:Hieracium lachenalii\">Hieracium lachenalii</a></i> (Cichoireideae)</li>\n<li><b>Cape Daisy</b> - <i><a href=\"https://en.wikipedia.org/wiki/Osteospermum_ecklonis\" class=\"extiw\" title=\"w:Osteospermum ecklonis\">Osteospermum ecklonis</a></i> (Asteroideae)</li></ol>",
