        "width": 2500,
        "height": 3750,
        "size": 5404658,
        "description": "Unripe <a href=\"https://en.wikipedia.org/wiki/drupe\" class=\"extiw\" title=\"en:drupe\">drupes</a> of <i><a href=\"https://en.wikipedia.org/wiki/Piper_nigrum\" class=\"extiw\" title=\"en:Piper nigrum\">en:Piper nigrum</a></i> in November at <a href=\"https://en.wikipedia.org/wiki/Trivandrum\" class=\"extiw\" title=\"en:Trivandrum\">Trivandrum</a>, Kerala, India. Black pepper is produced from these unripe drupes. The drupes are cooked briefly in hot water. The heat ruptures cell walls in the pepper, speeding the work of <a href=\"https://en.wikipedia.org/wiki/browning_(chemical_process)\" class=\"extiw\" title=\"en:browning (chemical process)\">browning</a> enzymes during drying. The drupes are dried for several days, during which the pepper around the seed shrinks and darkens into a thin, wrinkled black layer. Once dried, the spice is called black peppercorn.<br>White pepper consists of the seed of the pepper plant alone, with the darker coloured skin of the pepper fruit removed. This is usually accomplished by a process known as <a href=\"https://en.wikipedia.org/wiki/retting\" class=\"extiw\" title=\"en:retting\">retting</a>, where fully ripe red pepper berries are soaked in water for about a week, during which the flesh of the pepper softens and decomposes. Rubbing then removes what remains of the fruit, and the naked seed is dried.",
